import React from "react";
import { login } from '../auth';


const Dashboard = () => {
  const logout = () =>{
    e.preventDefault();
  }
  return (
    <div>
      <h1>Welcome to Dashboard</h1>
      <button onClick={logout}>
        Logout
      </button>
    </div>
  );
};

export default Dashboard;
